import React from "react";
import styled from "styled-components";
import MainContainer from "../components/MainContainer";

const Container = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  padding: 40px 20px;
  background-color: #fff;
`;

const MapContainer = styled.div`
  width: 100%;
  height: 300px;
  background-color: #e0e0e0;
  border-radius: 20px;
  position: relative;
  overflow: hidden;

  img {
    width: 100%;
    height: 100%;
    object-fit: cover;
  }
`;

const Title = styled.h1`
  margin-top: 15px;
  text-align: center;
  font-size: 30px;
  font-weight: 500;
`;

const RunningInfo = styled.div`
  display: flex;
  margin: 20px;
  flex-direction: column;
  gap: 5px;
`;

const RunningTitle = styled.p`
  font-size: 30px;
  font-weight: 600;
`;

const BadgeContainer = styled.div`
  display: flex;
  gap: 10px;
`;

const Badge = styled.span`
  background-color: #fff;
  border: 1px solid #2db4b1;
  padding: 5px 10px;
  border-radius: 20px;
  font-size: 16px;
  color: #333;
  gap: 10px;
`;

const Button = styled.button`
  padding: 12px 20px;
  background-color: #b4ffe3;
  color: #12918e;
  border: none;
  border-radius: 5px;
  cursor: pointer;
  font-size: 16px;
  font-weight: 600;
  width: 100%;

  &:hover {
    background-color: #3abf9a;
  }
`;

const Running = () => {
  return (
    <MainContainer>
      <Title>러닝 정보</Title>
      <Container>
        <MapContainer>
          <img src="../../img/ex_map.png" alt="지도" />
        </MapContainer>
        <RunningInfo>
          <span>24.10.28 / 20:00</span>
          <RunningTitle>중랑천 만보런</RunningTitle>
          <BadgeContainer>
            <Badge>서울</Badge>
            <Badge>빠르게</Badge>
          </BadgeContainer>
        </RunningInfo>
        <Button>참여하기</Button>
      </Container>
    </MainContainer>
  );
};

export default Running;
